    a = [len(part) for part in parts]
    if a[0] + a[1] < a[2] and a[2] != 1:
        a[0] += 1
        a[2] -= 1
    elif a[0] + a[1] > a[2] and a[0] + a[1] != 1:
        if a[0] != 1:
            a[0] -= 1
        else:
            a[1] -= 1
        a[2] += 1
    if a[0] + a[1] == a[2]:
        return '|' * a[0] + '+' + '|' * a[1] + '=' + '|' * a[1]
    else:
        return 'Impossible'

